//import openClose from "../Modules/openClose/openClose";
//import newId from "../Modules/newId/newId";
class Main extends React.Component {
  state = {
    shipments: []
  };

  async componentDidMount() {
    try {
      const data = await axios.get(
        `https://api.shipments.test-y-sbm.com/shipment`,
        {
          headers: {
            Authorization: `bearer ${localStorage.token}`
          }
        }
      );
      const list = data.data.data.shipments;
      console.log(list);
      this.setState({
        shipments: list
      });
      console.log(this.state.shipments[0].name);
    } catch (e) {
      //this.props.props.history.push("/login");
      //localStorage.clear();
    }
  }
  render() {
    const { props } = this;

    if (!props.isLoggedIn) {
      return <Redirect to="/login" />;
    }
    console.log(props);
    return (
      <>
        <Header props={props} />
        <Menu
          listOfShipments={this.state.shipments.map(shipment =>
            // <Shipment
            //   shipment={shipment}
